import React from "react";
import ReactDOM from "react-dom";
import CountrySelector from "./CountrySelector";

class Map extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedCountry: null,
      map: null,
      drawingManager: null,
      drawnShapes: [],
    };
  }

  componentDidMount() {
    // Load the Google Maps API script
    const script = document.createElement("script");
    script.src = `https://maps.googleapis.com/maps/api/js?key=AIzaSyCwz8tYryeQJeA_CI2nOvxzAwpQd1c80Pc&libraries=drawing&v=3.44`;
    script.async = true;
    script.onload = this.initMap;
    document.body.appendChild(script);
  }

  initMap = () => {
    // Initialize the Google Maps API
    const map = new window.google.maps.Map(document.getElementById("map"), {
      center: { lat: 0, lng: 0 },
      zoom: 2,
    });

    // Initialize the drawing manager
    const drawingManager = new window.google.maps.drawing.DrawingManager({
      drawingControl: true,
      drawingControlOptions: {
        position: window.google.maps.ControlPosition.TOP_CENTER,
        drawingModes: [
          window.google.maps.drawing.OverlayType.POLYGON,
          window.google.maps.drawing.OverlayType.RECTANGLE,
        ],
      },
    });

    // Add event listeners to the drawing manager
    window.google.maps.event.addListener(drawingManager, "overlaycomplete", (event) => {
      const { overlay } = event;

      // Add the drawn shape to the state and set its map
      const { drawnShapes } = this.state;
      drawnShapes.push(overlay);
      this.setState({ drawnShapes });

      // Disable drawing mode
      drawingManager.setDrawingMode(null);
    });

    // Set the map and drawing manager in the state
    this.setState({ map, drawingManager });
  };

  handleCountrySelect = (country) => {
    // Set the selected country in the state
    this.setState({ selectedCountry: country });

    // Get the map bounds for the selected country
    const { map } = this.state;
    const geocoder = new window.google.maps.Geocoder();
    geocoder.geocode({ address: country }, (results, status) => {
      if (status === "OK") {
        const bounds = results[0].geometry.bounds;
        map.fitBounds(bounds);

        // Show the drawing manager
        this.state.drawingManager.setMap(map);
      }
    });
  };

  clearDrawing = () => {
    // Loop through all the drawn shapes and remove them from the map
    const { drawnShapes } = this.state;
    drawnShapes.forEach((shape) => {
      shape.setMap(null);
    });

    // Clear the drawing manager's overlays array
    this.state.drawingManager.set("overlays", []);

    // Reset the drawing mode to rectangle
    this.state.drawingManager.setDrawingMode(
      window.google.maps.drawing.OverlayType.RECTANGLE
    );
  };

  render() {
    const { selectedCountry } = this.state;
    return (
      <div>
        <CountrySelector onCountrySelect={this.handleCountrySelect} />
        {selectedCountry && (
          <div>
            <div id="map" style={{ height: "500px", width: "100%" }}></div>
            <button onClick={this.clearDrawing}>Clear Drawing</button>
          </div>
        )}
      </div>
    );
  }
}

export default Map;
